            line-height: initial;
            display: flex;
            justify-content: center;
            align-items: center;
            width: 100%;
            font-weight: 600;
            border-width: 0;
            outline: none !important;
            transition: all 0.3s ease-in-out;
            cursor: pointer;
            border-radius: 4px;
            text-transform: uppercase;
