            span:first-of-type {
                display: flex;
                justify-content: center;
                align-items: center;
            }
            .anticon {
                display: flex;
                justify-content: center;
                align-items: center;
            }
        `,
        disabled &&
            css`
                cursor: not-allowed;
                filter: alpha(opacity=65);
                background-color: #cfcfcf;
                box-shadow: none;
                opacity: 0.65;
            `,
        variant === 'empty' &&
            css`
                border: 0;
                background-color: transparent;
                box-shadow: none;
                :hover,
                :active,
                :focus {
                    border: 0;
                    background-color: transparent;
                }
            `,
        variant === 'default' &&
            css`
                background-color: #cfcfcf;
                color: black;

                :hover,
                :focus {
                    background-color: ${THEME.GRAY};
                    outline-color: transparent;
                    outline-style: none;
                    ${THEME.BOX_SHADOW_GRAY}
                }
            `,
        variant === 'default-outlined' &&
            css`
                border: 1px solid ${THEME.GRAY};
                color: black;

                :hover,
                :focus {
                    background-color: ${THEME.GRAY};
                    outline-color: transparent;
                    outline-style: none;
                    ${THEME.BOX_SHADOW_GREEN}
                }
            `,
        variant === 'orange' &&
            css`
                border: 1px solid ${THEME.ORANGE};
                background-color: ${THEME.ORANGE};
                color: ${THEME.BLACK};

                :focus,
                :hover {
                    border: 1px solid ${THEME.ORANGE};
                    background-color: none;
                    outline-color: transparent;
                    outline-style: none;
                    color: ${THEME.BLACK};
                }
            `,
        variant === 'orange-outline' &&
            css`
                border: 1px solid ${THEME.ORANGE};
                background-color: white;
                color: black;

                :hover,
                :focus {
                    border: 1px solid ${THEME.ORANGE};
                    background-color: ${THEME.ORANGE};
                    outline-color: transparent;
                    outline-style: none;
                    color: ${THEME.WHITE};
                }
            `,

        variant === 'green' &&
            css`
                background-color: ${THEME.GREEN};
                color: white;

                :hover,
                :focus {
                    background-color: ${THEME.GREEN};
                    color: white;
                    outline-color: transparent;
                    outline-style: none;
                    ${THEME.BOX_SHADOW_GREEN}
                }
            `,
        variant === 'green-outline' &&
            css`
                border: 1px solid ${THEME.GREEN};
                background-color: ${THEME.WHITE};
                color: #000;

                :hover,
                :focus {
                    border: 1px solid ${THEME.GREEN};
                    outline-color: transparent;
                    outline-style: none;
                    color: ${THEME.BLACK};
                    ${THEME.BOX_SHADOW_GREEN}
                }
            `,
        variant === 'black-outline' &&
            css`
