                :hover,
                :focus {
                    border: 1px solid ${THEME.BLACK};
                    background-color: ${THEME.BLACK};
                    outline-color: transparent;
                    outline-style: none;
                    color: ${THEME.WHITE};
                }
            `,
        size === 'small' &&
            css`
                font-size: ${THEME.SMALL_FONT_SIZE};
                padding: 6px 12px;
                // height: 30px;

                * {
                    font-size: ${THEME.SMALL_FONT_SIZE};
                }
            `,
        size === 'medium' &&
            css`
                height: 34px;
                padding: 7px 12px;
                font-size: ${THEME.BASE_FONT_SIZE};
            `,
        size === 'large' &&
            css`
                // height: 40px;
                padding: 9px 12px;
                font-size: 20px;
            `,
    ],
    children: css`
        display: flex;
        justify-content: center;
        align-items: center;
        padding-top: 2px;
        padding-left: 4px;
    `,
};
